(136, 3, 800, 'esther.martin', 1300402800, 1300662000, '- Acción realizada:\r\n\r\nhablamos con Leticia Jefa de Servicio, quedamos en visitar lunes 10.30\r\n\r\n- Siguiente acción a realizar:\r\n\r\nvisita lunes 10.30', 0),
(137, 4, 790, 'esther.martin', 1300748400, 1301263200, '- Acción realizada:\r\n\r\ntiene la semana muy liada. \r\n\r\n- Siguiente acción a realizar:\r\n\r\nLlamar Lunes', 0),
(138, 3, 770, 'esther.martin', 1300748400, 1304373600, '- Acción realizada:\r\n\r\ncontactamos con Angela. Nos dice que va a estar liada y que se va un mes de vacaciones. \r\n\r\n- Siguiente acción a realizar:\r\n\r\nRetomar en Mayo', 0),
(139, 3, 637, 'esther.martin', 1300748400, 1300834800, '- Acción realizada:\r\nNos dijeron que llamaramos por la tarde, pero salta el contestador.\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nllamar por la mañana', 0),
(140, 4, 793, 'esther.martin', 1300748400, 1301263200, '- Acción realizada:\r\nllamamos en numerosas ocasiones. no coge el telefono. hablamos con el en el fijo y queda en volver a llamarnos. Parece interesarle pero luego no coge el teléfono.\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nesperar llamada sino intentar de nuevo. Plantear el envío de mail con el Ppto.', 0),
(141, 4, 771, 'esther.martin', 1300748400, 1300834800, '- Acción realizada:\r\n\r\nno se encuentra hoy\r\n\r\n- Siguiente acción a realizar:\r\n\r\nllamar', 0),
(142, 3, 801, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\nDESPUES DE MESES LLAMANDO PARA INTENTAR CONCERTAR UNA VISITA, NO NOS COGIAN TELF, QUEDABAN EN LLAMAR Y NO DEVOLVIAN LA LLAMADA. ROCIO CISCART PERSONA DE CONTACTO SE VA DE PERMISO DE BODA Y CONSEGUIMOS HABLAR CON LA PERSONA A LA QUE HA DEJADO A CARGO (CHARI)\r\nNOS CUENTA QUE ESTAN TRABAJANDO CON UNA EMPRESA DE SEVILLA. \r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(143, 8, 800, 'esther.martin', 1300662000, 1300921200, '- Acción realizada:\r\n\r\nQUEDAMOS A LAS 10.30. ESTA REUNIDA DICE QUE TARDARA MEDIA HORA. NOS DICEN QUE VA A RETRASARSE, VOLVEMOS A LAS 11.30, NOS DICEN QUE VOLVAMOS A LAS 12. TAMPOCO PUEDE ATENDERNOS PORQUE HA ENTRADO A COMEDOR.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nVOLVER A VISITAR 10.30', 0),
(144, 8, 802, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\nmiraran catalogo, si les interesa o quieren hacer algo nos llamaran. Prefieren que no les estemos llamando.\r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(145, 8, 802, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\n\r\nestan implantando ellos mismos la LOPD.\r\n\r\n- Siguiente acción a realizar:', 0),
(146, 8, 803, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\n\r\nNO VAN A HACER NADA POR EL MOMENTO. SI NECESITAN ALGO SE PONDRÁN EN CONTACTO CON NOSOTROS. \r\n\r\n- Siguiente acción a realizar:', 0),
(147, 8, 804, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\n\r\nESTAN ADAPTANDO ELLOS MISMOS LA EMPRESA A LA LOPD. POR EL MOMENTO Y COMO ESTA LA SITUACION NO VAN A HACER NADA.\r\n\r\n- Siguiente acción a realizar:', 0),
(148, 5, 784, 'esther.martin', 1300662000, 1301263200, '- Acción realizada:\r\n\r\nHAN TENIDO HACE POCO UNA INSPECCION DE SANIDAD, Y TIENEN QUE CENTRARSE EN LAS INCIDENCIAS DETECTADAS POR LA INSPECTORA. LES INTERESA TENER GLOBAL GAP PARA OCTUBRE. VAN A CERTIFICARSE COMO GRUPO DE PRODUCTORES, PERO TIENEN QUE INDICARNOS CUANTOS ENTRARÍAN PARA AJUSTAR PPTO SEGUN NUMERO.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nVER COMO VA TODO, INTENTAR FIRMA.', 0),
(149, 8, 581, 'esther.martin', 1300748400, NULL, '- Acción realizada:\r\nTIENEN GLOBAL GAP COMO GRUPO DE PRODUCTORES (4 SOCIOS), PRODUCCION INTEGRADA, TESCO... PENSABAN HACER BRC PERO POR EL MOMENTO LES BASTA CON LO QUE TIENEN. TIENEN CONTRATADO UN TECNICO QUE LES LLEVA EL MTO DE TODOS LOS SISTEMAS Y ESTAN MUY CONTENTOS CON EL, AUNQUE LES SALE UN POCO CARO. NOS OFRECEMOS PARA PASARLE PPTO, PERO DICE QUE NO VAN A CAMBIAR.\r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(150, 4, 775, 'esther.martin', 1300748400, 1301263200, '- Acción realizada:\r\n\r\nDICE QUE NOS LLAMARA EL VIERNES, HA HABLADO CON LA HERMANA DEL AGRICULTOR QUE QUIERE HACER GLOBAL Y ESTAN MUY INTERESADOS PERO ESTA EN CAMA CON FLEBITIS.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nESPERAR LLAMADA, SINO LLAMAR LUNES', 0),
(151, 5, 780, 'esther.martin', 1300748400, 1300921200, '- Acción realizada:\r\nENTREGAMOS OFERTA. LE PARECE BIEN PRECIO 90+420 FORCEM PERO QUIEN TIENE QUE APROBARLO ES SU HERMANO\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLLAMAR PARA FIRMAR', 0),
(152, 8, 805, 'esther.martin', 1300748400, 1300834800, '- Acción realizada:\r\n\r\nNO SE ENCUENTRA NINGUNO DE LOS DUEÑOS. LLAMAR PARA CONCERTAR NUEVA VISITA.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLLAMAMOS, PERO NO PUEDEN ATENDERNOS (ESTAN EN UN CURSO) LLAMAR POR LA MAÑANA, PARA VISITAR JUEVES', 0),
(153, 4, 259, 'esther.martin', 1300834800, 1300834800, '- Acción realizada:\r\n\r\nNo esta Alejandro. llamar mas tarde\r\n\r\n- Siguiente acción a realizar:', 0),
(154, 3, 797, 'esther.martin', 1300834800, 1301263200, '- Acción realizada:\r\nNo puede atendernos hasta el lunes, dice que le van a adjudicar las almejas¿?¿?\r\nquedamos en llevarle los Pptos.\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLlamar a primera hora y llevar Oferta', 0),
(155, 7, 780, 'esther.martin', 1300921200, 1301436000, '- Acción realizada:\r\n\r\naun no han podido mirarlo su hermano y ella. Nos llamará.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLlamar miercoles si no tenemos noticias.', 0),
(156, 3, 794, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\n\r\nhablamos con Eusebio, pero Antonio Cortes esta reunido con Endesa.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nVolver a llamar para ver cuando puede atendernos.', 0),
(157, 4, 774, 'esther.martin', 1300921200, 1301349600, '- Acción realizada:\r\n\r\naun no tiene respuesta del Dueño\r\n\r\n- Siguiente acción a realizar:\r\n\r\nllamar', 0),
(158, 8, 805, 'esther.martin', 1300921200, NULL, '- Acción realizada:\r\nno les interesa nada. No pueden invertir en nada, si en algun momento necesitan algo nos llamarán.\r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(159, 8, 610, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\n\r\nEmpresa interesante, transportes, excavaciones, aridos, fresas... y ahora van a abrir planta de reciclaje. Tienen Global Gap en campo y marcado ce de Aridos.\r\nLes interesa Ppto en Calidad y MA para recogida de escombros, hormigón y árido y calidad de producto para Arido.\r\n\r\n- Siguiente acción a realizar:\r\n\r\npreparar Ppto y entregar.', 0),
(160, 8, 807, 'esther.martin', 1300921200, NULL, '- Acción realizada:\r\n\r\nEL JUEVES PASADO ESTUVIERON REUNIDOS CON LA FEDERACIÓN (LARES) Y JUNTA DE ANDALUCIA Y NOS DICE QUE AUN NO ESTÁ DEFINIDO CLARAMENTE LA NORMA DE CALIDAD QUE VAN A EXIGIRLES. NOS DA CONTACTO DE LA FEDERACIÓN DE ANDALUCIA POR SI PODEMOS LLEGAR A ACUERDO.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nCONTACTO CON FEDERACION A TRAVES DE ALVARO. LLAMAR SI HAY ALGUNA NOVEDAD.', 0),
(161, 8, 806, 'esther.martin', 1300230000, NULL, '- Acción realizada:\r\n\r\nPREPARAR PPTO DE TRAZABILIDAD. ESTA MUY INTERESADO EN HERRAMIENTA INFORMATICA PARA LLEVAR TRAZABILIDAD\r\n\r\n- Siguiente acción a realizar:\r\n\r\nENTREGA OFERTA', 0),
(162, 5, 806, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\nENTREGA OFERTA. LE PARECE TODO MUY BIEN CONTENTO CON APLICACION INFORMATICA AUNQUE LE GUSTARÍA VER ALGO MAS. TIENE VARIAS CONSULTAS.\r\nVA ESTE FIN DE SEMANA A MADRID A UNA EXPO Y HA QUEDADO ALLI PARA VER UN PROGRAMA DE TRAZABILIDAD CON HERRAMIENTA DE FACTURACIÓN.\r\nQUEDAMOS EN QUE UNA VEZ SEPA EXACTAMENTE LO QUE QUIERE LO VERÍAMOS PARA VER SI PUEDE IMPLEMENTARSE EN LA HERRAMIENTA.\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLLAMAR LUNES', 0),
(163, 8, 808, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\nNO NECESITA NINGUN CERTIFICADO DE CALIDAD. SE DEDICA A LA VENTA AL POR MAYOR PERO A PEQUEÑOS NEGOCIOS, EXPORTACIÓN A PORTUGAL NADA MAS Y POCO. NO TIENE LOPD.\r\nQUEDAMOS EN LLEVAR PPTO.\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLLEVAR PPTO LOPD', 0),
(164, 8, 394, 'esther.martin', 1300921200, NULL, '- Acción realizada:\r\nTIENEN GLOBAL GAP Y 9001. NO LES INTERESA NADA MAS Y TIENEN CONSULTORA, ALBATROS. LES VA BIEN Y NO VAN A CAMBIAR.\r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(165, 8, 809, 'esther.martin', 1300921200, NULL, '- Acción realizada:\r\nESTAN CERTIFICADOS EN 9+14 DESDE HACE 4-5 AÑOS. TAMBIEN TIENEN HECHA LOPD. TRABAJAN CON IMP, SI DECIDEN CAMBIAR NOS LLAMARAN. NOS PEDIRAN PPTO PARA AUDITORIA INTERNA, PREFIEREN LLAMAR ELLOS.\r\n\r\n\r\n- Siguiente acción a realizar:', 0),
(166, 8, 810, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\nNO LES INTERESA NINGUNA CERTIFICACION. CREEN TENER LA LOPD PERO NO ESTAN SEGUROS. LO VERA CON SU JEFE.\r\n\r\n\r\n- Siguiente acción a realizar:\r\n\r\nCONSULTAR Y LLAMAR.', 0),
(167, 8, 800, 'esther.martin', 1300921200, 1301263200, '- Acción realizada:\r\n\r\nDICE QUE TIENEN YA PROTOCOLOS DE CALIDAD Y PROCEDIMIENTOS, LA RESIDENCIA ES MUY NUEVA. LE HABLAMOS DE LA IMPORTANCIA DE LA CERTIFICACION EN 9001. LO HABLARA CON LA DIRECTORA. \r\n\r\n- Siguiente acción a realizar:\r\n\r\nCONTACTAR DE NUEVO PARA VER SI HA HABLADO CON LA DIRECTORA Y LE INTERESA PASEMOS PPTO', 0),
(168, 5, 811, 'esther.martin', 1301007600, NULL, '- Acción realizada:\r\n\r\nCAMPAÑA LOPD\r\n\r\n- Siguiente acción a realizar:\r\n\r\nLLEVAR PPTO.', 0),
